{
  "AWSTemplateFormatVersion": "2010-09-09",
  "Description": "The template used to create an ECS Service from the ECS Console.",
  "Parameters": {
    "ECSClusterName": {
      "Type": "String",
      "Default": "c7n-test-cluster"
    },
    "ECSServiceName": {
      "Type": "String",
      "Default": "test"
    },
    "SecurityGroupIDs": {
      "Type": "CommaDelimitedList",
      "Default": "sg-6c7fa917"
    },
    "SubnetIDs": {
      "Type": "CommaDelimitedList",
      "Default": "subnet-efbcccb7,subnet-e3b194de,subnet-044d9e3b66dccd75a,subnet-914763e7"
    },
    "VpcID": {
      "Type": "String",
      "Default": "vpc-d2d616b5"
    },
    "LoadBalancerName": {
      "Type": "String",
      "Default": ""
    }
  },
  "Resources": {
    "ECSService": {
      "Type": "AWS::ECS::Service",
      "Properties": {
        "Cluster": "c7n-test-cluster",
        "TaskDefinition": "arn:aws:ecs:us-east-1:644160558196:task-definition/c7n-test-task-def-2:1",
        "LaunchType": "FARGATE",
        "ServiceName": "test",
        "SchedulingStrategy": "REPLICA",
        "DesiredCount": 1,
        "NetworkConfiguration": {
          "AwsvpcConfiguration": {
            "AssignPublicIp": "ENABLED",
            "SecurityGroups": {
              "Ref": "SecurityGroupIDs"
            },
            "Subnets": {
              "Ref": "SubnetIDs"
            }
          }
        },
        "PlatformVersion": "LATEST",
        "DeploymentConfiguration": {
          "MaximumPercent": 200,
          "MinimumHealthyPercent": 100,
          "DeploymentCircuitBreaker": {
            "Enable": true,
            "Rollback": true
          }
        },
        "DeploymentController": {
          "Type": "ECS"
        },
        "ServiceConnectConfiguration": {
          "Enabled": false
        },
        "Tags": [],
        "EnableECSManagedTags": true
      }
    }
  },
  "Outputs": {
    "ClusterName": {
      "Description": "The cluster used to create the service.",
      "Value": {
        "Ref": "ECSClusterName"
      }
    },
    "ECSService": {
      "Description": "The created service.",
      "Value": {
        "Ref": "ECSService"
      }
    }
  }
}
